          View Cart
        </Typography>
      </Grid>
    </Box>

    <Box
      sx={{ 
        margin: 2, 
        borderRadius: 2, 
        bgcolor: '#ECEBEB',
        height: '100%',
        display:"flex",
        flexDirection:"column"
      }}>
      <Button variant="outlined">
        Order
      </Button>
    </Box>
    </Container>

    )
}

export default Table;
